INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 106001, "キャル", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 7001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 105901, "コッコロ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 7002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 105801, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 7003, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 105801, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 10001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 106001, "キャル", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 10002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 105901, "コッコロ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 10003, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 1, 106401, "シェフィ", 2, "2015/12/17 15:00:00", 1, 0, -363.0, 10004, 0.0, 0.0, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 105801, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 0, -416.5, 12001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 106001, "キャル", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 13001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 105901, "コッコロ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 13002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 1, 106401, "シェフィ", 2, "2015/12/17 15:00:00", 1, 0, -363.0, 13003, 0.0, 0.0, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 105801, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 13004, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 105901, "コッコロ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 14001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 1, 106401, "シェフィ", 2, "2015/12/17 15:00:00", 1, 0, -363.0, 14002, 0.0, 0.0, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 105801, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 14003, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 106001, "キャル", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 14004, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 105901, "コッコロ", 1, "2015/12/17 15:00:00", 1, 0, -470.0, 15001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 1, 106401, "シェフィ", 2, "2015/12/17 15:00:00", 1, 0, -363.0, 16001, 0.0, 0.0, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 105801, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 16002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 106001, "キャル", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 16003, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 105901, "コッコロ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 16004, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 105901, "コッコロ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 17002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 106001, "キャル", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 17004, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 105901, "コッコロ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 17005, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 1, 106401, "シェフィ", 2, "2015/12/17 15:00:00", 1, 0, -363.0, 17006, 0.0, 0.0, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 105801, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 17007, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 190801, "カリン", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 18001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (18, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 2, 190801, "カリン", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 18002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (19, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 3, 190801, "カリン", 1, "2015/12/17 15:00:00", 1, 0, -470.0, 19001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (19, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 4, 190801, "カリン", 1, "2015/12/17 15:00:00", 1, 0, -470.0, 19002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 5, 190801, "カリン", 1, "2015/12/17 15:00:00", 1, 0, -470.0, 20001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 6, 190801, "カリン", 1, "2015/12/17 15:00:00", 1, 0, -470.0, 20002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 106001, "キャル", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 21001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 105901, "コッコロ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 21002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (21, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 1, 106401, "シェフィ", 2, "2015/12/17 15:00:00", 1, 0, -363.0, 21003, 0.0, 0.0, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 105801, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 0, -363.0, 21004, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 190801, "カリン", 1, "2015/12/17 15:00:00", 1, 0, -430.0, 22001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 2, 190801, "カリン", 1, "2015/12/17 15:00:00", 1, 0, -430.0, 22002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 3, 190801, "カリン", 1, "2015/12/17 15:00:00", 1, 0, -430.0, 23001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 4, 190801, "カリン", 1, "2015/12/17 15:00:00", 1, 0, -430.0, 23002, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 109001, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 2, 10011, -385.0, 24001, 4.08, 8.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, 109001, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 2, 10011, -385.0, 24002, 5.0, 8.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 3, 109001, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 2, 10011, -385.0, 24003, 10.11, 8.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4, 109001, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 2, 10011, -385.0, 24004, 4.0, 8.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 5, 109001, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 2, 10011, -385.0, 24005, 6.0, 8.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 6, 109002, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 10011, 0.0, 24006, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 7, 109002, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 10011, 0.0, 24007, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 8, 109002, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 10011, 0.0, 24008, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 9, 109002, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 10011, 0.0, 24009, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10, 109002, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 10011, 0.0, 24010, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 109101, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 2, 10011, -385.0, 24011, 2.12, 8.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, 109101, "シズル（バレンタイン）", 5, "2019/01/31 12:00:00", 2, 10011, -385.0, 24012, 4.19, 8.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 3, 109101, "シズル（バレンタイン）", 2, "2019/01/31 12:00:00", 4, 10011, -385.0, 24013, 2.3, 8.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 4, 109102, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 10011, 0.0, 24014, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 109101, "シズル（バレンタイン）", 5, "2019/01/31 12:00:00", 2, 10011, -385.0, 24015, 5.23, 8.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 6, 109102, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 10011, 0.0, 24016, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 7, 109101, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 2, 10011, -385.0, 24017, 5.01, 8.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 8, 109102, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 10011, 0.0, 24018, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 9, 109102, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 10011, 0.0, 24019, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 10, 109102, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 10011, 0.0, 24020, 0.0, 0.0, 0, "2030/12/17 14:59:59");
