INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (46, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 1, 123001, "アメス", 1, "2015/12/17 15:00:00", 1, 0, -371.5, 46001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (47, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 1, 104901, "シズル", 2, "2015/12/17 15:00:00", 2, 0, -416.5, 47001, 0.0, 0.0, 0, "2030/12/17 14:59:59");
